import React, { useState } from "react";
import { Link } from "react-scroll";

function Navbar() {
  const [navbarToggle, setNavbarToggle] = useState(false);

  const handleNavbarToggle = () => {
    setNavbarToggle(!navbarToggle);
  };
  return (
    <React.Fragment>
      <div className="home_page_navbar">
        <div className="ui secondary menu fixed">
          <div
            className={
              navbarToggle ? "mobile_back ui container" : "ui container"
            }
          >
            <Link
              className="logo"
              to="menu"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              <img src="/image/grood-w.png" />
            </Link>
            <div className="right menu">
              <Link
                className="active item web_menu_list"
                to="what_page_background_color"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                What's Grood?
              </Link>
              <Link
                className="item web_menu_list"
                to="why_section"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                For Better World!
              </Link>
              <Link
                className="item listbtn "
                to="pre_order_background"
                spy={true}
                smooth={true}
                offset={0}
                duration={500}
              >
                <button className="insize ui button">Pre-Order Now</button>
              </Link>
              <img
                src={navbarToggle ? "/image/close.png" : "/image/menu.png"}
                className="phone_menu"
                alt=""
                onClick={handleNavbarToggle}
              />
            </div>
          </div>

          <div
            class={
              navbarToggle
                ? "ui left demo vertical visible sidebar labeled icon menu"
                : "ui left demo vertical sidebar labeled icon menu"
            }
          >
            <Link
              className="item"
              to="what_page_background_color"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              What's Grood?
            </Link>
            <Link
              className="item"
              to="why_section"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              For Better World!
            </Link>
            <Link
              className="item "
              to="pre_order_background"
              spy={true}
              smooth={true}
              offset={0}
              duration={500}
            >
              Pre-Order Now
            </Link>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Navbar;
